import React from "react";
//import Carts from "../Carts/Carts";



const Products = (props) => {
    return ( 
        <React.Fragment>
            {Products.map(p => (
                <Carts
                key={this.props.p.id}
                product={this.props.p}
                ></Carts>
            ))} 
        </React.Fragment>
    );
}

export default Products;
